★ディアドラの中綿セットアップ！<br>
<br>
●素材には光沢感があり、中綿入りで保温性に優れています。<br>
●袖はゴム入りで程よくフィット！両サイドにはポケット付き。<br>
●表面には撥水加工を施しています！<br>
●パンツはウエストゴムに紐でサイズ調節が可能。<br>
●裾はジッパーで大きく開閉。さらにドローコードで足首にフィットさせる事ができます。<br>
<br>
■素材<br>
表地、裏地、中綿：ポリエステル100％<br>
■企画製造販売元<br>
新社名 株式会社ディーエムアール<br>
旧社名 株式会社ディアドラ・ジャパン<br>
