★アンブロのピステ上下セット！<br>
<br>
●特殊繊維が創り上げるハイストレッチ素材を、運動科学の視点から適切な部位に配置したピステ上下セット。<br>
●運動時のストレスを軽減し、タイトなシルエットでありながら快適な着心地が魅力です。<br>
●トップス袖口、パンツ裾口はゴム入りでほどよいフィット感！<br>
●脇の切替部に特殊構造の高通気はっ水素材を配置し、運動時に発生する衣服内の熱気をコントロールします。<br>
●パンツ腰、膝裏にも通気性を考慮したメッシュ素材を配置！<br>
●金具のないプルオーバータイプで、ボールコントロールに集中できます！<br>
<br>
■素材<br>
本体：ポリエステル88％、ポリウレタン12％<br>
脇部・前後衿、後身頃上部・膝裏切替：ポリエステル100％<br>
■企画製造販売元 株式会社デサント<br>
