<br>
●裾にドローコードが付いているので冷風などの侵入を防げます。<br>
●両サイドにポケット内蔵。<br>
●秋冬シーズンにおいて不可欠な「暖かさ」に焦点をあてたHigh Function GearシリーズのHEAT MAX搭載！<br>
●特殊なコーティングを生地裏面に施すことにより、撥水性能が従来品より20～30％UP！(当社比)<br>
<br>
■素材 ポリエステル100％<br>
■企画製造販売元 株式会社ゴールドウイン<br>
